  `whsStoreKeeper` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `isActive` tinyint(1) NOT NULL,
  `companyId` int(10) unsigned NOT NULL,
  `SubFactoryLevel` varchar(200) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `updatedBy` int(10) unsigned NOT NULL,
  `createdBy` int(10) unsigned NOT NULL,
  `hash` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
